import React, { useState, useCallback } from 'react';
import {
  View,
  Text,
  StyleSheet,
  FlatList,
  TextInput,
  TouchableOpacity,
  RefreshControl,
  SafeAreaView,
} from 'react-native';

// Job interface
interface Job {
  id: string;
  title: string;
  company: string;
  location: string;
  type: string;
  category: string;
  salary: string;
  description: string;
  requirements: string[];
  remote: boolean;
  urgent: boolean;
  views: number;
  applications: number;
  postedAt: Date;
}

// Mock job data
const mockJobs: Job[] = [
  {
    id: '1',
    title: 'Senior React Native Developer',
    company: 'TechCorp Inc.',
    location: 'San Francisco, CA',
    type: 'full-time',
    category: 'technology',
    salary: '$120,000 - $150,000',
    description: 'We are looking for an experienced React Native developer to join our mobile team.',
    requirements: ['5+ years React Native experience', 'TypeScript proficiency', 'Mobile app deployment experience'],
    remote: false,
    urgent: false,
    views: 12,
    applications: 3,
    postedAt: new Date(),
  },
  {
    id: '2',
    title: 'UX/UI Designer',
    company: 'Design Studio Pro',
    location: 'New York, NY',
    type: 'full-time',
    category: 'design',
    salary: '$80,000 - $110,000',
    description: 'Join our creative team to design beautiful and functional user experiences.',
    requirements: ['3+ years UX/UI experience', 'Figma expertise', 'Portfolio required'],
    remote: true,
    urgent: false,
    views: 8,
    applications: 5,
    postedAt: new Date(Date.now() - 24 * 60 * 60 * 1000),
  },
  {
    id: '3',
    title: 'Digital Marketing Specialist',
    company: 'Marketing Solutions Ltd',
    location: 'Remote',
    type: 'full-time',
    category: 'marketing',
    salary: '$60,000 - $85,000',
    description: 'Drive our digital marketing campaigns and grow our online presence.',
    requirements: ['SEO/SEM experience', 'Social media marketing', 'Analytics tools proficiency'],
    remote: true,
    urgent: true,
    views: 15,
    applications: 7,
    postedAt: new Date(Date.now() - 2 * 24 * 60 * 60 * 1000),
  },
  {
    id: '4',
    title: 'Senior Software Engineer',
    company: 'StartupXYZ',
    location: 'Austin, TX',
    type: 'full-time',
    category: 'technology',
    salary: '$110,000 - $140,000',
    description: 'Lead backend development for our AI-powered platform.',
    requirements: ['5+ years backend experience', 'Python/Node.js', 'Cloud platforms (AWS/GCP)'],
    remote: true,
    urgent: false,
    views: 25,
    applications: 8,
    postedAt: new Date(Date.now() - 3 * 24 * 60 * 60 * 1000),
  },
  {
    id: '5',
    title: 'Registered Nurse - ICU',
    company: 'City General Hospital',
    location: 'Boston, MA',
    type: 'full-time',
    category: 'healthcare',
    salary: '$75,000 - $90,000',
    description: 'Provide excellent patient care in our intensive care unit.',
    requirements: ['RN license', 'BSN preferred', 'ICU experience'],
    remote: false,
    urgent: true,
    views: 20,
    applications: 10,
    postedAt: new Date(Date.now() - 4 * 24 * 60 * 60 * 1000),
  }
];

const HomeScreen: React.FC = () => {
  const [jobs, setJobs] = useState<Job[]>(mockJobs);
  const [searchQuery, setSearchQuery] = useState('');
  const [refreshing, setRefreshing] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  // Filter jobs based on search query
  const filteredJobs = jobs.filter((job) =>
    job.title.toLowerCase().includes(searchQuery.toLowerCase()) ||
    job.company.toLowerCase().includes(searchQuery.toLowerCase()) ||
    job.category.toLowerCase().includes(searchQuery.toLowerCase()) ||
    job.location.toLowerCase().includes(searchQuery.toLowerCase())
  );

  const onRefresh = useCallback(() => {
    setRefreshing(true);
    // Simulate API call
    setTimeout(() => {
      setRefreshing(false);
    }, 1000);
  }, []);

  const handleLogin = () => {
    setIsLoggedIn(!isLoggedIn);
  };

  const formatTimeAgo = (date: Date) => {
    const now = new Date();
    const diffMs = now.getTime() - date.getTime();
    const diffHours = Math.floor(diffMs / (1000 * 60 * 60));
    const diffDays = Math.floor(diffHours / 24);

    if (diffHours < 24) {
      return `${diffHours}h ago`;
    } else {
      return `${diffDays}d ago`;
    }
  };

  const getCategoryIcon = (category: string) => {
    const icons: { [key: string]: string } = {
      technology: 'üíª',
      design: 'üé®',
      marketing: 'üìà',
      healthcare: 'üè•',
      finance: 'üí∞',
      education: 'üéì',
      engineering: '‚öôÔ∏è',
    };
    return icons[category] || 'üíº';
  };

  const renderJobCard = ({ item }: { item: Job }) => (
    <TouchableOpacity style={styles.jobCard} activeOpacity={0.7}>
      <View style={styles.jobHeader}>
        <View style={styles.jobTitleSection}>
          <Text style={styles.jobTitle}>{item.title}</Text>
          <Text style={styles.company}>{item.company}</Text>
        </View>
        <View style={styles.jobMeta}>
          <Text style={styles.categoryIcon}>{getCategoryIcon(item.category)}</Text>
          {item.urgent && <Text style={styles.urgentTag}>üî•</Text>}
        </View>
      </View>

      <View style={styles.jobDetails}>
        <Text style={styles.location}>üìç {item.location}</Text>
        <Text style={styles.salary}>üí∞ {item.salary}</Text>
        {item.remote && <Text style={styles.remoteTag}>üåê Remote</Text>}
      </View>

      <Text style={styles.description} numberOfLines={2}>
        {item.description}
      </Text>

      <View style={styles.jobFooter}>
        <Text style={styles.timeAgo}>{formatTimeAgo(item.postedAt)}</Text>
        <View style={styles.stats}>
          <Text style={styles.statText}>üëÅ {item.views}</Text>
          <Text style={styles.statText}>üìù {item.applications}</Text>
        </View>
      </View>
    </TouchableOpacity>
  );

  return (
    <SafeAreaView style={styles.container}>
      {/* Header with search and login */}
      <View style={styles.header}>
        <View style={styles.searchContainer}>
          <TextInput
            style={styles.searchInput}
            placeholder="Search jobs..."
            value={searchQuery}
            onChangeText={setSearchQuery}
          />
        </View>
        <TouchableOpacity 
          style={[styles.loginButton, isLoggedIn && styles.loggedInButton]} 
          onPress={handleLogin}
        >
          <Text style={[styles.loginText, isLoggedIn && styles.loggedInText]}>
            {isLoggedIn ? 'üë§' : 'Login'}
          </Text>
        </TouchableOpacity>
      </View>

      {/* Job count */}
      <View style={styles.jobCount}>
        <Text style={styles.jobCountText}>
          {filteredJobs.length} job{filteredJobs.length !== 1 ? 's' : ''} found
        </Text>
      </View>

      {/* Jobs list */}
      <FlatList
        data={filteredJobs}
        renderItem={renderJobCard}
        keyExtractor={(item) => item.id}
        refreshControl={
          <RefreshControl refreshing={refreshing} onRefresh={onRefresh} />
        }
        contentContainerStyle={styles.jobsList}
        showsVerticalScrollIndicator={false}
      />
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#f8f9fa',
  },
  header: {
    flexDirection: 'row',
    padding: 16,
    backgroundColor: '#fff',
    alignItems: 'center',
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 3,
  },
  searchContainer: {
    flex: 1,
    marginRight: 12,
  },
  searchInput: {
    height: 40,
    borderWidth: 1,
    borderColor: '#ddd',
    borderRadius: 20,
    paddingHorizontal: 16,
    backgroundColor: '#f8f9fa',
  },
  loginButton: {
    backgroundColor: '#007AFF',
    paddingHorizontal: 16,
    paddingVertical: 8,
    borderRadius: 20,
  },
  loggedInButton: {
    backgroundColor: '#34C759',
  },
  loginText: {
    color: '#fff',
    fontWeight: '600',
  },
  loggedInText: {
    fontSize: 18,
  },
  jobCount: {
    paddingHorizontal: 16,
    paddingVertical: 8,
    backgroundColor: '#fff',
    borderBottomWidth: 1,
    borderBottomColor: '#eee',
  },
  jobCountText: {
    color: '#666',
    fontSize: 14,
  },
  jobsList: {
    padding: 16,
  },
  jobCard: {
    backgroundColor: '#fff',
    borderRadius: 12,
    padding: 16,
    marginBottom: 12,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 3,
  },
  jobHeader: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'flex-start',
    marginBottom: 8,
  },
  jobTitleSection: {
    flex: 1,
  },
  jobTitle: {
    fontSize: 18,
    fontWeight: 'bold',
    color: '#333',
    marginBottom: 4,
  },
  company: {
    fontSize: 14,
    color: '#666',
  },
  jobMeta: {
    flexDirection: 'row',
    alignItems: 'center',
  },
  categoryIcon: {
    fontSize: 20,
    marginRight: 8,
  },
  urgentTag: {
    fontSize: 16,
  },
  jobDetails: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    marginBottom: 8,
    gap: 12,
  },
  location: {
    fontSize: 12,
    color: '#666',
  },
  salary: {
    fontSize: 12,
    color: '#34C759',
    fontWeight: '600',
  },
  remoteTag: {
    fontSize: 12,
    color: '#007AFF',
  },
  description: {
    fontSize: 14,
    color: '#555',
    lineHeight: 20,
    marginBottom: 12,
  },
  jobFooter: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
  },
  timeAgo: {
    fontSize: 12,
    color: '#999',
  },
  stats: {
    flexDirection: 'row',
    gap: 12,
  },
  statText: {
    fontSize: 12,
    color: '#999',
  },
});

export default HomeScreen;
